petalRenderMap.Compass = (p) => {

    ctx.lineWidth = 2.4;


    ctx.beginPath();
    ctx.fillStyle = blendColor('#3498db', '#FF0000', blendAmount(p));
    ctx.strokeStyle = blendColor('#bfbfbf', '#FF0000', blendAmount(p));
    let redCompass = blendColor('#e74c3c', '#FF0000', blendAmount(p))
    let whiteCompass = blendColor('#ecf0f1', '#FF0000', blendAmount(p))
    let centerDot = ctx.strokeStyle;

    //glow
    //shadow
    if (p.glow >= 0) {
        ctx.save();

        let glowColor = Colors.rarities[p.glow].color
        let extraRadius = 0;
        if (p.glow >= 8) {
            //omega+
            extraRadius += 0.5
        }
        if (p.glow >= 11) {
            //supreme+
            extraRadius += 0.5
        }
        if (p.glow == 11) {
            //make slightly brighter
            glowColor = "#db68f7"
        }
        ctx.fillStyle = glowColor
        ctx.globalAlpha = 0.7;

        ctx.arc(0, 0, p.radius * (2 + extraRadius + 0.3 * Math.cos(Date.now() / 500)) * flowrMod.compassScale, 0, Math.PI * 2);
        ctx.fill();
        ctx.globalAlpha = 1;

        ctx.restore();

        redCompass = blendColor(glowColor, '#FF0000', blendAmount(p));
        centerDot = blendColor(Colors.rarities[p.glow].border, '#FF0000', blendAmount(p));

    }

    if (checkForFirstFrame(p)) {
        ctx.fillStyle = "#FFFFFF";
        ctx.strokeStyle = "#FFFFFF";
        redCompass = "#FFFFFF";
        whiteCompass = "#FFFFFF";
    }





    ctx.beginPath();
    ctx.arc(0, 0, p.radius, 0, Math.PI * 2);
    ctx.fill();
    ctx.stroke();
    ctx.closePath();

    ctx.fillStyle = redCompass;
    ctx.beginPath();
    ctx.lineTo(0, -p.radius * 0.4);
    ctx.lineTo(p.radius, 0);
    ctx.lineTo(0, p.radius * 0.4);
    ctx.fill();
    ctx.closePath();

    ctx.fillStyle = whiteCompass;
    ctx.beginPath();
    ctx.lineTo(0, -p.radius * 0.4);
    ctx.lineTo(-p.radius, 0);
    ctx.lineTo(0, p.radius * 0.4);
    ctx.fill();
    ctx.closePath();

    ctx.fillStyle = centerDot;
    ctx.beginPath();
    ctx.arc(0, 0, p.radius / 4, 0, Math.PI * 2);
    ctx.fill();
    ctx.closePath();


}
petalRenderMap["Waterlogged Compass"] = (p) => {
    ctx.lineWidth = 2.4;


    ctx.beginPath();
    ctx.fillStyle = blendColor('#70a7cf', '#FF0000', blendAmount(p));
    ctx.strokeStyle = blendColor('#bfbfbf', '#FF0000', blendAmount(p));
    let redCompass = blendColor('#3c3fe7', '#FF0000', blendAmount(p))
    let whiteCompass = blendColor('#ecf0f1', '#FF0000', blendAmount(p))
    let centerDot = ctx.strokeStyle;

    //glow
    //shadow
    if (p.glow > 0) {
        ctx.save();

        let glowColor = `hsl(${(Date.now() / 15) % 360}, 50%, 50%)`
        let extraRadius = 0;

        ctx.fillStyle = glowColor
        ctx.globalAlpha = 0.7;

        ctx.arc(0, 0, p.radius * (2 + extraRadius + 0.3 * Math.cos(Date.now() / 500)) * flowrMod.compassScale, 0, Math.PI * 2);
        ctx.fill();
        ctx.globalAlpha = 1;

        ctx.restore();

        redCompass = blendColor(glowColor, '#FF0000', blendAmount(p));
        centerDot = blendColor(Colors.rarities[p.glow].border, '#FF0000', blendAmount(p));

    }

    if (checkForFirstFrame(p)) {
        ctx.fillStyle = "#FFFFFF";
        ctx.strokeStyle = "#FFFFFF";
        redCompass = "#FFFFFF";
        whiteCompass = "#FFFFFF";
    }





    ctx.beginPath();
    ctx.arc(0, 0, p.radius, 0, Math.PI * 2);
    ctx.fill();
    ctx.stroke();
    ctx.closePath();

    ctx.fillStyle = redCompass;
    ctx.beginPath();
    ctx.lineTo(0, -p.radius * 0.4);
    ctx.lineTo(p.radius, 0);
    ctx.lineTo(0, p.radius * 0.4);
    ctx.fill();
    ctx.closePath();

    ctx.fillStyle = whiteCompass;
    ctx.beginPath();
    ctx.lineTo(0, -p.radius * 0.4);
    ctx.lineTo(-p.radius, 0);
    ctx.lineTo(0, p.radius * 0.4);
    ctx.fill();
    ctx.closePath();

    ctx.fillStyle = centerDot;
    ctx.beginPath();
    ctx.arc(0, 0, p.radius / 4, 0, Math.PI * 2);
    ctx.fill();
    ctx.closePath();

}
petalRenderMap["Dark Compass"] = (p) => {

    ctx.lineWidth = 2.4;


    ctx.beginPath();
    ctx.fillStyle = blendColor('#db3434', '#FF0000', blendAmount(p));
    ctx.strokeStyle = blendColor('#bfbfbf', '#FF0000', blendAmount(p));
    let redCompass = blendColor('#3c9de7', '#FF0000', blendAmount(p))
    let whiteCompass = blendColor('#ecf0f1', '#FF0000', blendAmount(p))
    let centerDot = ctx.strokeStyle;

    //glow
    //shadow
    if (p.glow >= 0) {
        ctx.save();

        let glowColor = Colors.rarities[p.glow].color
        let extraRadius = 0;
        if (p.glow >= 8) {
            //omega+
            extraRadius += 0.5
        }
        if (p.glow >= 11) {
            //supreme+
            extraRadius += 0.5
        }
        if (p.glow == 11) {
            //make slightly brighter
            glowColor = "#db68f7"
        }
        ctx.fillStyle = glowColor
        ctx.globalAlpha = 0.7;

        ctx.arc(0, 0, p.radius * (2 + extraRadius + 0.3 * Math.cos(Date.now() / 500)) * flowrMod.compassScale, 0, Math.PI * 2);
        ctx.fill();
        ctx.globalAlpha = 1;

        ctx.restore();

        redCompass = blendColor(glowColor, '#FF0000', blendAmount(p));
        centerDot = blendColor(Colors.rarities[p.glow].border, '#FF0000', blendAmount(p));

    }

    if (checkForFirstFrame(p)) {
        ctx.fillStyle = "#FFFFFF";
        ctx.strokeStyle = "#FFFFFF";
        redCompass = "#FFFFFF";
        whiteCompass = "#FFFFFF";
    }





    ctx.beginPath();
    ctx.arc(0, 0, p.radius, 0, Math.PI * 2);
    ctx.fill();
    ctx.stroke();
    ctx.closePath();

    ctx.fillStyle = redCompass;
    ctx.beginPath();
    ctx.lineTo(0, -p.radius * 0.4);
    ctx.lineTo(p.radius, 0);
    ctx.lineTo(0, p.radius * 0.4);
    ctx.fill();
    ctx.closePath();

    ctx.fillStyle = whiteCompass;
    ctx.beginPath();
    ctx.lineTo(0, -p.radius * 0.4);
    ctx.lineTo(-p.radius, 0);
    ctx.lineTo(0, p.radius * 0.4);
    ctx.fill();
    ctx.closePath();

    ctx.fillStyle = centerDot;
    ctx.beginPath();
    ctx.arc(0, 0, p.radius / 4, 0, Math.PI * 2);
    ctx.fill();
    ctx.closePath();


}

