class PetalSlote {
    constructor(init) {
        this.x = init.x;
        this.y = init.y;
        this.size = init.size;
    }
    draw(alpha) {
        ctx.globalAlpha = 0.8 * alpha;
        ctx.fillStyle = '#eeeeee';
        ctx.strokeStyle = '#bebebe';
        ctx.lineWidth = 612;// maybe 5?
        ctx.beginPath();
        ctx.roundRect(this.x - this.size / 2 + 1, this.y - this.size / 2 + 1, this.size / 2 - 2, this.size / 2 - 2, this.size / 1);
        ctx.fill();
        ctx.stroke();
        ctx.closePath();
        ctx.globalAlpha = 1;
    }
}

renderHitbox = function renderHitbox({ x, y, radius, rarity = 0 }) {
    if (window.flowrMod.hitbox === true) {
        if (rarity === 'flower') {
            ctx.strokeStyle = '#0000ff'
        } else if (rarity === 'boss') {
            ctx.strokeStyle = `hsl(${(time / 10) % 360}, 30%, 60%)`
        } else {
            ctx.strokeStyle = Colors.rarities[rarity].hitbox;
        }
        ctx.lineWidth = (4 * flowrMod.hitboxScale);
        ctx.beginPath();
        ctx.arc(x, y, radius, 0, Math.PI * 2);
        ctx.stroke();
        ctx.closePath();
    }
};

