const menu = document.querySelector('.menu');

const fullscreen = {
    ratio: 9 / 16,
    zoom: 1200,
}
let renderScale = 1;

function resize(){
    const dpi = window.devicePixelRatio;
    canvas.style.width = Math.ceil(window.innerWidth) + 'px';
    canvas.style.height = Math.ceil(window.innerHeight) + 'px';
    canvas.width = Math.ceil(window.innerWidth) * dpi;
    canvas.height = Math.ceil(window.innerHeight) * dpi;
    canvas.zoom = Math.max(0.1, Math.round((Math.max(canvas.height, canvas.width * fullscreen.ratio) / fullscreen.zoom * renderScale) * 100) / 100);
    // w and h are calced with zoom
    canvas.w = canvas.width / canvas.zoom;
    canvas.h = canvas.height / canvas.zoom;
    // ctx.translate(canvas.width/2, canvas.height/2);
    ctx.scale(canvas.zoom, canvas.zoom);
    // ctx.translate(-canvas.width/2, -canvas.height/2);
    ctx.lineJoin = 'round';
    ctx.lineCap = 'round';
    // ctx.imageSmoothingEnabled = false;

    // also scaling the menu
    menu.style.width = Math.ceil(window.innerWidth) / canvas.zoom * dpi / 1.65 + 'px';
    menu.style.height = Math.ceil(window.innerHeight) / canvas.zoom * dpi / 1.65 + 'px';
    menu.style.transform = `scale(${canvas.zoom / dpi * 1.65})`;
    menu.style.transformOrigin = `0px 0px`;

    // also scaling the login menu if applicable
    if(window.state === "account"){
        const loginMenu = document.querySelector('.login-menu');
        loginMenu.style.width = Math.ceil(window.innerWidth) / canvas.zoom * dpi / 1.65 + 'px';
        loginMenu.style.height = Math.ceil(window.innerHeight) / canvas.zoom * dpi / 1.65 + 'px';
        loginMenu.style.transform = `scale(${canvas.zoom / dpi * 1.65})`;
        loginMenu.style.transformOrigin = `0px 0px`;
    }

    menuInventory.positionPetalSlots();
    inventory.positionPetalSlots();
    levelBar.calculateDimensions();
    GraceBar.calculateDimensions("grace");
    TimeBar.calculateDimensions("time");

    biomeManager.updateArrowDimensions();
    globalInventory.resizeScroll();
    changelog.resizeScroll();

    if(window.is3D === true) window.resize3D();
}

window.addEventListener('resize', function () {
    resize();
});

draw = function draw() {
    time = performance.now();
    dt = time - lastTime;
    lastTime = time;

    if (dt > 1000) {
        // dt = 1000;
        dt = 0;
    }

    if (window.state === "account") {
        renderAccountMenu(dt);
    } else if (window.state === "menu") {
        renderMenu(dt);
    } else {
        renderGame(dt);
        if (window.state === "disconnected") {
            renderDisconnectedText(dt);
        }
    }

    let server = {
        'location': 'Chicago',
        'type': 1
    }
    if (ws.url.split('//')[1].split('.')[0] === 'server2') {
        server.location = 'Frankfurt'
        server.type = 2
    }

    if (window.toRenderDebug === true) {
        window.framesRendered++;
        if (window.framesRendered > 10) {
            const now = performance.now();
            window.fps = Math.floor(window.framesRendered / (now - window.lastFramesRenderedResetTime) * 1000);
            window.lastFramesRenderedResetTime = now;
            window.framesRendered = 0;
        }
        renderDebug();
        ctx.fillStyle = "#aaddff";
        ctx.strokeText(`ThivScript, Server: ${server.location} (server${server.type})`, canvas.w - 2, canvas.h - 17);
        ctx.fillText(`ThivScript, Server: ${server.location} (server${server.type})`, canvas.w - 2, canvas.h - 17);
    }
}

window.flowrMod.calcSpecialWave = function calcSpecialWave(input) {
    let ignoredMobs = [
        "RockMissile",
        "BigRockMissile",
        "Missile",
        "BeeMissile",
        "StarfishMissile",
        "FireMissile",
        "UrchinMissile",
        "BossUrchinMissile",
        "BigBossUrchinMissile",
        "ScorpionMissile",
        "LocustMissile",
        "SplitLocustMissile",
        "DandelionMissile",
        "BossDandelionMissile",
        "InvisibleUrchin",
        "Ant Egg",
        "Fire Ant Egg",
        "Queen Ant",
        "Fire Queen Ant",
    ]
    if (room.wave > 10 && room.wave !== window.flowrMod.prev.wave) {
        window.flowrMod.registeredEnemyTypes = []
        if (window.flowrMod.percents.special < 25) {
            window.flowrMod.percents.special += 5
        }
        window.flowrMod.percents.special += 4.5
    } else if (room.wave === window.flowrMod.prev.wave) {
        if (!window.flowrMod.registeredEnemyTypes.includes(input.type) && !ignoredMobs.includes(input.type)) {
            window.flowrMod.registeredEnemyTypes.push(input.type)
        }
        if (
            window.flowrMod.registeredEnemyTypes.includes('Ladybug') && window.flowrMod.registeredEnemyTypes.includes('Hornet') ||
            window.flowrMod.registeredEnemyTypes.includes('Ladybug') && window.flowrMod.registeredEnemyTypes.includes('Hornet') ||
            window.flowrMod.registeredEnemyTypes.includes('Ladybug') && window.flowrMod.registeredEnemyTypes.includes('Dandelion') ||
            window.flowrMod.registeredEnemyTypes.includes('Dark Ladybug') && window.flowrMod.registeredEnemyTypes.includes('Hornet') ||
            window.flowrMod.registeredEnemyTypes.includes('Evil Centipede') ||
            window.flowrMod.registeredEnemyTypes.includes('Centipede') && window.flowrMod.registeredEnemyTypes.includes('Bee') ||
            window.flowrMod.registeredEnemyTypes.includes('Dark Ladybug') && window.flowrMod.registeredEnemyTypes.includes('Bee') ||

            window.flowrMod.registeredEnemyTypes.includes('Shiny Ladybug') ||
            window.flowrMod.registeredEnemyTypes.includes('Desert Centipede') ||
            window.flowrMod.registeredEnemyTypes.includes('Cactus') && window.flowrMod.registeredEnemyTypes.includes('Beetle') ||
            window.flowrMod.registeredEnemyTypes.includes('Scorpion') && window.flowrMod.registeredEnemyTypes.includes('Beetle') ||
            window.flowrMod.registeredEnemyTypes.includes('Fire Ant Burrow') && window.flowrMod.registeredEnemyTypes.includes('Beetle') ||
            window.flowrMod.registeredEnemyTypes.includes('Sandstorm') && window.flowrMod.registeredEnemyTypes.includes('Beetle') ||
            window.flowrMod.registeredEnemyTypes.includes('Desert Moth') && window.flowrMod.registeredEnemyTypes.includes('Beetle') ||
            window.flowrMod.registeredEnemyTypes.includes('Locust') && window.flowrMod.registeredEnemyTypes.includes('Beetle') ||

            window.flowrMod.registeredEnemyTypes.includes('Shell') && window.flowrMod.registeredEnemyTypes.includes('Crab') ||
            window.flowrMod.registeredEnemyTypes.includes('Starfish') && window.flowrMod.registeredEnemyTypes.includes('Jellyfish') ||
            window.flowrMod.registeredEnemyTypes.includes('Starfish') && window.flowrMod.registeredEnemyTypes.includes('Crab') ||
            window.flowrMod.registeredEnemyTypes.includes('Starfish') && window.flowrMod.registeredEnemyTypes.includes('Leech') ||
            window.flowrMod.registeredEnemyTypes.includes('Starfish') && window.flowrMod.registeredEnemyTypes.includes('Sea Urchin') ||
            window.flowrMod.registeredEnemyTypes.includes('Starfish') && window.flowrMod.registeredEnemyTypes.includes('Sponge')
        ) {
            return;
        }
        if (window.flowrMod.registeredEnemyTypes.includes('Plastic') && room.waveTimer > 250 && window.flowrMod.registeredEnemyTypes.length <= 5) {
            window.flowrMod.percents.special -= 21
            flowrMod.percents.specialWaves++
            for (let i = 0; i < 5; i++) {
                window.flowrMod.registeredEnemyTypes.push('Filler')
            }
            return;
        } else if (room.waveTimer > 250 && window.flowrMod.registeredEnemyTypes.length <= 5) {
            window.flowrMod.percents.special -= 21
            flowrMod.percents.specialWaves++
            for (let i = 0; i < 5; i++) {
                window.flowrMod.registeredEnemyTypes.push('Filler')
            }
            return;
        }
    }
    if (flowrMod.percents.special < 0) flowrMod.percents.special = 0
}

window.flowrMod.calcBossWave = function calcBossWave(input) {
    if (room.wave >= 40 && room.wave !== window.flowrMod.prev.wave) {
        if (input !== 'boss') {
            if (window.flowrMod.percents.boss <= 17.5) {
                window.flowrMod.percents.boss += 5
            } else {
                window.flowrMod.percents.boss += 2.5
            }
        } else {
            window.flowrMod.percents.boss -= 27
            flowrMod.percents.bossWaves++
        }
    }
    if (flowrMod.percents.boss < 0) flowrMod.percents.boss = 0
}

flowrMod.calcLuckyWave = function calcLuckyWave(input) {
    if (room.wave > 10 && room.wave !== flowrMod.prev.wave) {
        if (input !== 'lucky') {
            flowrMod.percents.lucky += flowrMod.percents.luckyIncrease.percent
        } else {
            flowrMod.percents.lucky -= 20
            flowrMod.percents.luckyWaves++
        }
    }
    if (flowrMod.percents.lucky < flowrMod.percents.luckyIncrease.percent * 4) flowrMod.percents.lucky = flowrMod.percents.luckyIncrease.percent * 4
    if (flowrMod.percents.lucky < 0) flowrMod.percents.lucky = 0
}

window.flowrMod.generatePetalContainer = function generatePetalContainer(type, rarity, amount) {
    let stats = Stats.petals[type][rarity]

    let petals = []

    let pcStats = {}

    let allowList = [
        'rotateSpeedBuff',
        'effect',
        'speedBuff',
        'passiveHealingBuff',
        'spawnSystem',
        'lifespan',
        'knockbackMass',
        'healthBuff',
        'damageHeal',
        'shield',
        'bodyKnockback',
        'percentDamagePerDeadFlower',
        'waveSpeed'
    ]

    for (let i of Object.keys(stats)) {
        if (Object.keys(Descriptions.petals).includes(type) && i === 'customBiome') {
            continue;
        }
        pcStats[i] = stats[i]
    }
    if (stats.petalLayout.length > 0) {
        if (stats.petalLayout.length > 1) {
            stats.petalLayout[0] = stats.petalLayout
        }

        for (let i of stats.petalLayout[0]) {
            petals.push(new Petal({
                x: 0,
                y: 0,
                angle: 0,
                radius: pcStats.radius,
                type,
                rarity,
                damage: pcStats.damage,
                offset: { angle: 5.026548245743669, distance: 0 },
                distance: 0,
                dv: 0,
                id: Math.random(),
                subId: 0,
                subStackedId: 0,
                dead: false,
                hp: pcStats.health,
                maxHp: pcStats.health,
                reload: pcStats.reload,
                maxReload: pcStats.reload,
                angleOffset: 0,
                stickParentRotation: true,
                petalContainerId: 0
            }))
        }
    } else {
        petals.push(new Petal({
            x: 0,
            y: 0,
            angle: 0,
            radius: pcStats.radius,
            type,
            rarity,
            damage: pcStats.damage,
            offset: { angle: 5.026548245743669, distance: 0 },
            distance: 0,
            dv: 0,
            id: Math.random(),
            subId: 0,
            subStackedId: 0,
            dead: false,
            hp: pcStats.health,
            maxHp: pcStats.health,
            reload: pcStats.reload,
            maxReload: pcStats.reload,
            angleOffset: 0,
            stickParentRotation: true,
            petalContainerId: 0
        }))
    }

    let pc = new PetalContainer(petals, { x: 0, y: 0, w: 50, h: 50, toOscillate: false, radius: 0 }, Math.random(), amount, 0)
    pc.petalStats = {}

    for (let i of Object.keys(pcStats)) {
        if (!Object.keys(statColors).includes(i) && !allowList.includes(i)) {
            /*if (i !== 'radius' && i !== 'override' && i !== 'knockback' && i !== 'damageScalers' && i !== 'healthScalers' && i !== 'healScalers' && i !== 'petalLayout' && i !== 'attackDistanceMult') {
            console.log(i)
            }*/
            continue;
        }
        pc.petalStats[i] = pcStats[i]
    }

    return pc
}

