newMap.newEnemy = (data, me, advanced) => {
    if (window.flowrMod.prev.wave == 0) window.flowrMod.prev.sw = room.wave
    if (data.isBoss) {
        let addBoss = true;
        if (data.type == "Leech" || data.type == "BudLeech" || data.type == "Electric Eel") {
            if (!data.isHead) {
                addBoss = false;
            }
        }
        if (addBoss) {
            bosses.push({ id: data.id, maxHp: data.maxHp });
            if (isNaN(totalBossHealth)) {
                totalBossHealth = 0;
            }
            totalBossHealth = totalBossHealth + data.maxHp;
            bossCount += 1;
            window.flowrMod.calcBossWave('boss')
        }
    } else if (!window.flowrMod.bossActive && room.wave !== window.flowrMod.prev.sw) {
        window.flowrMod.calcSpecialWave(data)
        window.flowrMod.calcBossWave(data)
        if (room.shinyWave !== false && room.shinyWave >= 1) {
            flowrMod.calcLuckyWave('lucky')
        } else {
            flowrMod.calcLuckyWave()
        }
    }
    if (window.flowrMod.prev.wave !== room.wave && window.flowrMod.bossActive) {
        delete window.flowrMod.bossActive
    }
    window.flowrMod.prev.wave = room.wave
    room.addNewEnemy(data);
}

