                ctx.strokeText(`(Lvl200 feature)`, canvas.w / 2 - this.w / 2 + 7.5, canvas.h / 2 - 7.5 + 86);
                ctx.fillText(`(Lvl200 feature)`, canvas.w / 2 - this.w / 2 + 7.5, canvas.h / 2 - 7.5 + 86);
